export { getSectionCategory, getSectionManufacture, getProductsSections, loadProducts};
function getSectionCategory(section) {
	var res = [];
	console.log('getSectionCategory:', section);
	if (Object.keys(this.categories[section].categories).length === 0 ){
		return getSectionManufacture(section);
	}

	for (var key in this.categories[section].categories) {
		res.push({'id': key, 'title': this.categories[section].categories[key].name})
	}
	return res;
}

function getSectionManufacture(section) {
	console.log('getSectionManufacture:', section);
	var res = [];
	for (var key in this.categories[section].manufactures) {
		res.push({'id': key, 'title': this.categories[section].manufactures[key].name})
	}
	return res;
}

function getProductsSections() {
	var res = [];
	for (var key in this.categories) {
		res.push({'id': key, 'title': this.categories[key].title})
	}
	return res;
}
function loadProducts(section, subsection) {
	// console.log('loadProducts',section, subsection )
	// let res = await dataCrawler.crawl_data(section,subsection);
	if(!this.all_products[section] || !this.all_products[section][subsection]){
		return [];
	}
	return this.all_products[section][subsection];
}

